import React from "react";
import "./Navbar.css";

class Navbar extends React.Component {
    render () {
        return (
            <nav className="navbar">
                <ul id="navlist">
                    <li id="first">Option1</li>
                    <li>Option2</li>
                    <li>Option3</li>
                    <li>Option4</li>
                </ul>
            </nav>
        )
    }
}

export default Navbar;
